Om+.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// 需要确保 Lagrange.sol 已经部署，并且 Lagrange_cha 的接口已知
import "./Lagrange.sol";

contract OmPlus3 {
    // 存储 Merkle Root 和两个数字
    bytes32 public merkleRoot;
    uint256 public num1;
    uint256 public num2;
    uint256[4] fCommitment;

    // 定义 Commitment 结构
    struct Commitment {
        uint256[4] numbers;
    }

    // 定义 VerifyInfo 结构
    struct VerifyInfo {
        uint256[5] outputWires;
        uint256[5] sigmas;
    }

    // 将可见性更改为 private
    Commitment[] private commitments;
    VerifyInfo[] private verifyInfos;
    uint256 public r;


    function storeMerkleRootAndNumbers(bytes32 _merkleRoot, uint256 _num1, uint256 _num2) external {
        merkleRoot = _merkleRoot;
        num1 = _num1;
        num2 = _num2;
    }

    function storeCommitments(Commitment[] memory _commitments) external {
        for(uint i = 0; i < _commitments.length; i++) {
            commitments.push(_commitments[i]);
        }
    }

    function storeVerifyInfosAndR(VerifyInfo[] memory _verifyInfos, uint256 _r) external {
        for(uint i = 0; i < _verifyInfos.length; i++) {
            verifyInfos.push(_verifyInfos[i]);
        }
        r = _r;
    }

    function calculateFinalCommitment() external returns (uint256[4] memory) {
        uint256[4] memory finalCommitment = [uint256(1), 1, 1, 1]; // 初始化为1
        for (uint i = 0; i < commitments.length; i++) {
            for (uint j = 0; j < 4; j++) {
                finalCommitment[j] *= commitments[i].numbers[j];
            }
        }
        // 存储最终的 commitment
        fCommitment = finalCommitment;
        return finalCommitment;
    }



}

Lagrange.sol.content:
// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.9.0;

library Lagrange_cha {

    function array_mul(int256 front, int256[] calldata x_array, uint256 point) public returns (int256 tmp) { 
        int256 subr;
        int256 r = 1;
        for (uint256 p = 0; p < x_array.length; p++) {
            if (p==point){
                r = 1 * r;
            } else{
                subr = front - x_array[p];
                r = r * subr;
            }
            
        }
        return r;
    }

    function y_mul_array(int256[] calldata y,int256[] memory lagrange_array) public returns(int256 result){
        int256 tmp = 0;
        for (uint256 p = 0; p < lagrange_array.length; p++) {
            tmp = tmp + y[p] * lagrange_array[p];
        }
        return tmp;
    }

    function lagrange(int256 pp, int256[] calldata xs, int256[] calldata ys) public returns (int256 result) {
        int256 sum = 0;
        for(uint256 p=0; p<xs.length; p++){
            int256 up;
            int256 down;
            up = array_mul(0, xs, p);
            down = array_mul(xs[p], xs, p);
            sum = sum + (up / down) * ys[p];
        }
        int256 tmp = sum%pp;
        if (tmp>0){
            return tmp;
        }else {
            return tmp+pp;   
        }
    }

}

